import React from 'react';
import './index.css';

const About = () => {
    return (
        <section id="about" className="about">
            <h2>About Me</h2>
            <p>Hello! I'm Lalitha Vislavath, a developer specializing in Html,Css,JavaScript,React js.</p>
            <p>Here are some of the technologies I work with:</p>
            <ul>
                <li>HTML</li>
                <li>CSS</li>
                <li>JavaScript</li>
                <li>React</li>
            </ul>
        </section>
    );
};

export default About;
